import React from "react";
import {Link} from 'react-router-dom'
import {
  Col,
  DropdownItem,
  DropdownMenu,
  DropdownToggle,
  Row,
  UncontrolledDropdown
} from "reactstrap";

import {Dropdown,Icon,Message,Menu,Button} from 'antd'

import { Calendar, Filter, RefreshCw } from "react-feather";

const menu = (
<Menu >
    <Menu.Item key="1">
      <Icon type="user" />
      1st menu item
    </Menu.Item>
    <Menu.Item key="2">
      <Icon type="user" />
      2nd menu item
    </Menu.Item>
    <Menu.Item key="3">
      <Icon type="user" />
      3rd item
    </Menu.Item>
  </Menu>
)
const ProjectHeader = ({props}) => {
  return (
    <Row className="mb-2 mb-xl-4">
      <Col xs="auto" className="d-none d-sm-block">
        <h3>{props.project.project_title}</h3>
      </Col>

      <Col xs="auto" className="ml-auto text-right mt-n1">
      <Dropdown.Button overlay={menu}>
        {props.account.subdomain}
      </Dropdown.Button>
{/*}
        <Button color="primary" className="shadow-sm mr-1 atn-btn-project">
          <Link to={`/${props.account.subdomain}/projects`}>Project Hub</Link>
        </Button>

        <Button color="primary" className="shadow-sm mr-1">
          <Filter className="feather" />
        </Button>
        <Button color="primary" className="shadow-sm">
          <RefreshCw className="feather" />
        </Button>*/}
      </Col>
    </Row>
  );
};

export default ProjectHeader;
